  false,\n\t\"url\": null,\n\t\"notes\": \" After each decennial census, the Census
  Bureau delineates urban areas that represent densely developed territory, encompassingn
  \              residential, commercial, and other nonresidential urban land uses.
  In general, this territory consists of areas of high population density and urban
  landn               use resulting in a representation of the \"urban footprint.\"
  There are two types of urban areas: urbanized areas (UAs) that contain 50,000 or
  more peoplen               and urban clusters (UCs) that contain at least 2,500
  people, but fewer than 50,000 people (except in the U.S. Virgin Islands and Guam
  which each containn               urban clusters with populations greater than 50,000).
  Each urban area is identified by a 5-character numeric census code that may contain
  leading zeroes.n            \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
